// STEP 7: Import useLoader Data AND the Link
import { useLoaderData, Link } from 'react-router-dom'


// Do we need the below?
import { useNavigate } from 'react-router-dom'


function CaseList() {


  // replace this with data from the loader //
  // const cases = []  
  // STEP 8: Set the cases data above. Remember that it is an array
  // so has to be in curly braces

  const { cases } = useLoaderData()

  // 
  const mappedCards = cases.map(caseObj => (
    <div key = {caseObj.id} className="participant-card">
      <h3>{caseObj.name}</h3>
      <p>{caseObj.clues}</p>
      {/* NOTE in the below had to chahge this from "cases" to "caseslist" based on how we named the links in the index */}
      <Link to={ `/caselist/${caseObj.id}` }>Go To Case</Link>
    </div>
  ))

  return (
    <div className="participant-list">
      { mappedCards }
    </div>
  )
}

export default CaseList
